import { Table } from "react-bootstrap";
import axios from "axios";
import { useEffect, useState } from "react";
import _ from "lodash";

const FilesInDisplay = () => {
  const [libraryFiles, setLibraryFiles] = useState([]);
  const [error, setError] = useState("");
  useEffect(() => {
    axios
      .get("./fileDetails.json")
      .then((response) => {
        setLibraryFiles(response.data);
      })
      .catch((error) => {
        setError(error);
      });
  }, []);

  useEffect(() => {
    libraryFiles.map((val) => {
      console.log("mapped files: ", val);
    });
  }, [libraryFiles]);
  return (
    <>
      bootstraps coulumns be like:
      <Table>
        <thead>
          <tr>
            <th>FileName</th>
            <th>FileSize</th>
            <th>Date Created</th>
          </tr>
        </thead>
        <tbody>
          {libraryFiles.map((val, index) => {
            return (
              <tr>
                <td>{val.name}</td>
                <td>{val.size}</td>
                <td>{val.date}</td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    </>
  );
};

export default FilesInDisplay;
